            id={props.id}
            min={props.min}
            name={props.name}
            onInput={props.onInput}
            value={props.value}
          ></input>
        </div>
      </div>
    </form>
  );
}
export function InputNumberRight(props) {
  return (
    <form class="mt-3">
      <div class="form-group row">
        <h5 class="col-sm-8">
          <label for={props.id} class="form-label">
            {props.label}
          </label>
        </h5>
        <div class="row col-sm-4 align-items-center">
          <input
            type="tel"
            class="form-range"
            id={props.id}
            min={props.min}
            name={props.name}
            onInput={props.onInput}
            value={props.value}
          ></input>
          <span class="col-sm-1"><b>{props.unit}</b></span>
        </div>
      </div>
    </form>
  );
}


